    if (pct <= um[0]) return pal[0];
    if (pct <= um[1]) return pal[1];
    if (pct <= um[2]) return pal[2];
    if (pct <= um[3]) return pal[3];
    return pal[4];

  function makeCandLayer(id, label, distrito){
    return L.geoJSON(SECCIONES, {
      pane: "candPane",

<script>

    });

    try {
      if (typeof municipiosLayer !== "undefined" && municipiosLayer && municipiosLayer.setStyle){
        municipiosLayer.setStyle({fill:false, fillOpacity:0, interactive:false});
      }

        contornoD6.setStyle({fill:false, interactive:false});
      }
      if (typeof contornoD7 !== "undefined" && contornoD7 && contornoD7.setStyle){
        contornoD7.setStyle({fill:false, interactive:false});
      }
    } catch(e) {}

    // B) Geocoder TOP-LEFT (quita el viejo si existe)
    try {
      document.querySelectorAll(".leaflet-control-geocoder").forEach(function(el){ el.remove(); });
      L.Control.geocoder({
        position: "topleft",
        defaultMarkGeocode: true,
        placeholder: "Buscar direccin",
        geocoder: L.Control.Geocoder.nominatim()
      }).addTo(map);
    } catch(e) {}

    var old = document.querySelector(".cand-box");
    if (old) old.style.display = "none";

    // ================= CONFIG: MS CATEGORAS + MS DETALLE CERCA DE 0 =================
    var NBINS = 7;      // recomendado 7
    var GAMMA = 2.0;    // 1.5 suave / 2.0 ms detalle / 2.5 sper detalle cerca de 0

    // Helpers color
    function hexToRgb(h){
      if (!h) return [0,0,0];
      h = h.replace("#","");
      if (h.length===3) h = h[0]+h[0]+h[1]+h[1]+h[2]+h[2];
      var n = parseInt(h,16);
      return [(n>>16)&255,(n>>8)&255,n&255];
    }
    function rgbToHex(r,g,b){
      function c(x){ var s=x.toString(16); return s.length===1?("0"+s):s; }
      return "#"+c(r)+c(g)+c(b);
    }
    function lerp(a,b,t){ return a + (b-a)*t; }
    function mixHex(c1,c2,t){
      var a=hexToRgb(c1), b=hexToRgb(c2);
      return rgbToHex(
        Math.round(lerp(a[0],b[0],t)),
        Math.round(lerp(a[1],b[1],t)),
        Math.round(lerp(a[2],b[2],t))
      );
    }
    function expandPalette(base, n){
      if (!base || base.length<2) return Array(n).fill("#999999");
      if (n <= base.length) return base.slice(0,n);
      var out = [];
      var segs = base.length - 1;
      for (var i=0; i<n; i++){
        var p = (n===1) ? 0 : (i/(n-1));
        var s = p * segs;
        var si = Math.min(segs-1, Math.floor(s));
        var t = s - si;
        out.push(mixHex(base[si], base[si+1], t));
      }
      return out;
    }
    function niceUp(x){ return (x>0) ? (Math.ceil(x*10)/10) : 0; }

    // ================== HOMOLOGAR PALETAS POR PARTIDO ==================
    // candLabels trae algo como: "Nombre Apellido (MC)" -> extraemos "MC"
    function extractParty(lbl){
      if (!lbl) return "OTROS";
      var m = String(lbl).match(/\(([^)]+)\)\s*$/);
      return (m && m[1]) ? String(m[1]).trim() : "OTROS";
    }

    var partyById = {};           // id -> "MC"
    var partyPaletteBase = {};    // "MC" -> [..base5..]

    for (var i=0; i<candKeys.length; i++){
      var id0 = candKeys[i];
      var party = extractParty(candLabels[i]);
      partyById[id0] = party;
      if (!partyPaletteBase[party]){
        var pal0 = (typeof palettesById !== "undefined" && palettesById && palettesById[id0]) ? palettesById[id0] : null;
        partyPaletteBase[party] = pal0 || ["#ffffff","#d9d9d9","#bdbdbd","#969696","#636363"];
      }
    }

    // ================== OVERRIDES SOLO PARA DIFERENCIAR MAZ y MC ==================
    // MAZ: azul petrleo (para que NO se confunda con NAZ)
    partyPaletteBase["MAZ"] = ["#E9F4F6", "#B9DCE2", "#7EBCC7", "#3F8392", "#0B3D4D"];
    // MC: naranja (evita verse amarillo tipo PRD)
    partyPaletteBase["MC"]  = ["#FFF2E6", "#FFD7B3", "#FFB266", "#FF8A1A", "#CC5200"];

    // D) CALCULAR MAX GLOBAL
    var globalMax = 0;
    try {
      if (SECCIONES && SECCIONES.features && candKeys && candKeys.length){
        SECCIONES.features.forEach(function(f){
          var p = (f && f.properties) ? f.properties : {};
          for (var i=0; i<candKeys.length; i++){
            var v = p["pct_" + candKeys[i]];
            if (v !== null && v !== undefined && v !== "" && !isNaN(v)){
              var num = Number(v);
              if (num > globalMax) globalMax = num;
            }
          }
        });
      }
    } catch(e) {}

    // E) UMBRALES GLOBALES con densidad cerca de 0
    var GLOBAL_UM = [];
    if (globalMax > 0 && NBINS >= 2){
      var prev = 0;
      for (var k=1; k<NBINS; k++){
        var raw = globalMax * Math.pow(k/NBINS, GAMMA);
        var thr = niceUp(raw);
        if (thr <= prev) thr = prev + 0.1;
        prev = thr;
        GLOBAL_UM.push(thr);
      }
    }

    function getColorLocal(v, thresholds, colors){
      if (v === null || v === undefined || v === "" || isNaN(v)) return "#d9d9d9";
      var x = Number(v);
      for (var i=0; i<thresholds.length; i++){
        if (x <= thresholds[i]) return colors[i];
      }
      return colors[colors.length-1];
    }

    // F) makeCandLayer GLOBAL (usa GLOBAL_UM + PALETA POR PARTIDO)
    function makeCandLayerGlobal(id, label, distrito){
      var party = partyById[id] || "OTROS";
      var basePal = partyPaletteBase[party] || ["#ffffff","#d9d9d9","#bdbdbd","#969696","#636363"];
      var palX = expandPalette(basePal, NBINS);

      return L.geoJSON(SECCIONES, {
        pane: "candPane",
        filter: function(feature){
          var p = feature.properties || {};
          return Number(p.DISTRITO_L) === Number(distrito);
        },
        style: function(feature){
          var p = feature.properties || {};
          var pct = p["pct_" + id];
          return {
            pane:"candPane",
            interactive:true,
            color:"#000",
            weight:1,
            opacity:1,
            fillColor:getColorLocal(pct, GLOBAL_UM, palX),
            fillOpacity:0.55
          };
        },
        onEachFeature: function(feature, layer){
          var p = feature.properties || {};
          var votos = p["v_" + id];
          var pct   = p["pct_" + id];
          var vtot  = p.vtotal;
          var html = "<div style=\"font-size:13px; line-height:1.25;\">" +
            "<div style=\"font-weight:900; margin-bottom:6px;\">" + label + "</div>" +
            "<b>Seccin:</b> " + (p.SECCION ?? "") + "<br>" +
            "<b>Distrito local:</b> " + (p.DISTRITO_L ?? "") + "<br>" +
            "<b>Distrito federal:</b> " + (p.DISTRITO_F ?? "") + "<br>" +
            "<b>Municipio:</b> " + (p.MUNIC_NOMBRE ?? "") + "<br>" +
            "<b>Votos (todas las formas):</b> " + (votos ?? "") + "<br>" +
            "<b>% del candidato:</b> " + (isNaN(pct) ? "" : Number(pct).toFixed(2) + "%") + "<br>" +
            "<b>VTOTAL:</b> " + (vtot ?? "") +
          "</div>";
          layer.bindPopup(html);
          layer.on("click", function(e){ layer.openPopup(e.latlng); });
        }
      });
    }

    // G) Crear capas candidaturas
    var candLayers2 = {};
    for (var i=0; i<candKeys.length; i++){
      var id = candKeys[i];
      var shortLabel = "DL" + candDL[i] + " - " + candLabels[i];
      candLayers2[id] = makeCandLayerGlobal(id, shortLabel, candDL[i]);
    }

    // H) Leyenda dinmica BOTTOM-LEFT (adaptada a NBINS) + PALETA POR PARTIDO
    var legendDiv = null;
    var legendControl = L.control({position:"bottomleft"});
    legendControl.onAdd = function(map){
      var div = L.DomUtil.create("div", "legend-box");
      div.style.display = "none";
      L.DomEvent.disableClickPropagation(div);
      L.DomEvent.disableScrollPropagation(div);
      legendDiv = div;
      return div;
    };
    legendControl.addTo(map);

    function fmt(n){
      if (n === null || n === undefined || isNaN(n)) return "";
      return Number(n).toFixed(2);
    }

    function updateLegend(id){
      if (!legendDiv) return;
      if (!id){ legendDiv.style.display = "none"; return; }

      var party = partyById[id] || "OTROS";
      var basePal = partyPaletteBase[party] || ["#ffffff","#d9d9d9","#bdbdbd","#969696","#636363"];
      var palX = expandPalette(basePal, NBINS);

      var idx = candKeys.indexOf(id);
      var title = (idx >= 0) ? ("DL" + candDL[idx] + " - " + candLabels[idx]) : id;

      var rows = [];
      if (GLOBAL_UM.length === NBINS-1){
        rows.push({c: palX[0], lab: "0  " + fmt(GLOBAL_UM[0]) + "%"});
        for (var i=1; i<GLOBAL_UM.length; i++){
          rows.push({c: palX[i], lab: fmt(GLOBAL_UM[i-1]) + "  " + fmt(GLOBAL_UM[i]) + "%"});
        }
        rows.push({c: palX[palX.length-1], lab: ">" + fmt(GLOBAL_UM[GLOBAL_UM.length-1]) + "%"});
      }
      rows.push({c: "#d9d9d9", lab: "Sin dato"});

      var html = "";
      html += "<div class=\"legend-title\">Simbologa</div>";
      html += "<div class=\"legend-sub\">% del candidato (" + NBINS + " categoras, cortes comparables)</div>";
      html += "<div style=\"font-weight:800; font-size:12px; margin-bottom:6px;\">" + title + "</div>";
      rows.forEach(function(r){
        html += "<div class=\"legend-row\">" +
                  "<span class=\"legend-swatch\" style=\"background:" + r.c + "\"></span>" +
                  "<span>" + r.lab + "</span>" +
                "</div>";
      });
      legendDiv.innerHTML = html;
      legendDiv.style.display = "block";
    }

    // I) Control Candidaturas TOP-RIGHT
    var candControl2 = L.control({position:"topright"});
    candControl2.onAdd = function(map){
      var div = L.DomUtil.create("div", "cand-box2");
      var html = "<div class=\"cand2-title\">Candidaturas</div>";
      html += "<div class=\"cand2-list\">";
      function addGroup(dl){
        html += "<div class=\"cand2-group\">DL" + dl + "</div>";
        for (var i=0; i<candKeys.length; i++){
          if (Number(candDL[i]) !== Number(dl)) continue;
          var id = candKeys[i];
          var label = "DL" + candDL[i] + " - " + candLabels[i];
          html += "<label class=\"cand2-item\">" +
                  "<input type=\"checkbox\" class=\"cand2-chk\" value=\"" + id + "\">" +
                  "<span>" + label + "</span>" +
                "</label>";
        }
      }
      addGroup(6);
      addGroup(7);
      html += "</div>";
      html += "<button id=\"cand2-clear\">Quitar todas</button>";
      div.innerHTML = html;
      L.DomEvent.disableClickPropagation(div);
      L.DomEvent.disableScrollPropagation(div);
      return div;
    };
    candControl2.addTo(map);

    function refreshCand2(){
      Object.keys(candLayers2).forEach(function(k){
        if (map.hasLayer(candLayers2[k])) map.removeLayer(candLayers2[k]);
      });
      document.querySelectorAll(".cand2-chk:checked").forEach(function(cb){
        map.addLayer(candLayers2[cb.value]);
      });
    }

    // J) Mover Layers Control a BOTTOM-RIGHT
    try {
      var lc = document.querySelector(".leaflet-control-layers");
      var br = document.querySelector(".leaflet-bottom.leaflet-right");
      if (lc && br) br.appendChild(lc);
    } catch(e) {}

    // K) Eventos: checkbox -> capas + leyenda
    document.addEventListener("change", function(e){
      if (e.target && e.target.classList && e.target.classList.contains("cand2-chk")){
        refreshCand2();
        if (e.target.checked) updateLegend(e.target.value);
        else {
          var any = document.querySelector(".cand2-chk:checked");
          updateLegend(any ? any.value : null);
        }
      }
    });

    document.addEventListener("click", function(e){
      if (e.target && e.target.id === "cand2-clear"){
        document.querySelectorAll(".cand2-chk").forEach(function(cb){ cb.checked = false; });
        refreshCand2();
        updateLegend(null);
      }
    });

  } catch(err) {
    console.error("PATCH ERROR:", err);
  }
})();
</script>
<!-- ===================== FIN PATCH ===================== -->

</body>
</html>
